                MuP  = 0.0982*kbp*D^3*Ftu; % ultimate failing moment for pin
                %bLugM = (0.019*(2*nTLugs+1)+0.19)*1.51/2*t;
                bLugM = t/(2*(nTLugs+1)) + 0.51*t/(2*nTLugs) + gBolt;
                
                % transverse             
                Ptru = Ktru*Ftu*D*t; % ----------------- need to find Ktru
                Ptry = 1.304*Ktry*Fty*D*t;
                    
                
                MSbru = Pbru/(FspanwiselLift/nTLugs*1.5*1.15) - 1; % shear out ultimate
                MSbry = Pbry/(FspanwiselLift/nTLugs*1.15) - 1; % shear out yield
                MSnu = Pnu/(FspanwiselLift/nTLugs*1.5*1.15) - 1; % tension ultimate
                MSny = Pny/(FspanwiselLift/nTLugs*1.15) - 1; % tension yield
                MSbb = MuP/(FspanwiselLift/(nTLugs+1)*bLugM) - 1; % bolt bending in limit case
                MStru = Ptru/(-FupAtFold/(2*nTLugs+1)*1.5*1.15) - 1; % transverse load
                MStry = Ptry/(-FupAtFold/(2*nTLugs+1)*1.15) - 1; % yield load
                MSbs = PusP/(FspanwiselLift/nTLugs*1.5*1.15) - 1; % bolt shear

                
                

                % full moment of particular spar at fold goes to bottom hinge
                % Full vertical force of outer wing goes to top lug
%                 MSsu = Psu/(FspanwiselLift/nTLugs*1.5*1.15) - 1; % shear out ultimate
%                 MSsy = Psy/(FspanwiselLift/nTLugs*1.15) - 1; % shear out yield              
%                 MSteu = Ptu/(FspanwiselLift/nTLugs*1.5*1.15) - 1; % tension ultimate
%                 MStey = Pty/(FspanwiselLift/nTLugs*1.15) - 1; % tension yield
%                 MStr = Ptr/(-FupAtFold/nTLugs*1.15) - 1; % 
%                 MSbs = Pbs/(FspanwiselLift/nTLugs*1.5*1.15) - 1;
%                 MSbb = BBM/(FspanwiselLift/(nTLugs*(nTLugs+1))*bLugM) - 1; % bolt bending in limit case
        %         fprintf('shear = %.2f \ntension = %.2f \ntransverse = %.2f \nbolt bending = %.2f\n',MS1s,MS1te,MS1tr,MSbb)
            end

%             MSshearu(dIndex,tIndex) = MSsu;
%             MSsheary(dIndex,tIndex) = MSsy;
%             MStensionu(dIndex,tIndex) = MSteu;
%             MStensiony(dIndex,tIndex) = MStey;
%             MStransverse(dIndex,tIndex) = MStr;
%             MSbshear(dIndex,tIndex) = MSbs;
%             MSbending(dIndex,tIndex) = MSbb;
%             weightLugT(dIndex,tIndex) = lugWeightF;
%             WLightestT(dIndex,tIndex) = lugTotalWidth*1000; %Wlug*1000;

            %fprintf('D: %.3f | t: %.3f | W: %.3f | m: %.2f | shear = %.2f %.2f, tension = %.2f %.2f, bolt bending = %.2f, transverse = %.2f %.2f, pin shear = %.2f\n',D*25.4,t*25.4,Wlug*25.4,minWdisp*0.453592, MSbru,MSbry,MSnu,MSny,MSbb,MStru,MStry,MSbs)

            if lugWeightF < minWdisp
                minWdisp = lugWeightF;
                Ddisp = D_name*25.4;
                minWvalues = [lugTotalWidth*25.4, t*25.4, Wlug*25.4, MSbru, MSbry, MSnu, MSny, MSbb, MStru, MStry, MSbs];
            end
            tIndex = tIndex + 1;

        end
        dIndex = dIndex + 1;
    end
    
    minTopLugWeight(end+1) = minWdisp*0.453592;
    minTopLugWidth(end+1) = minWvalues(1); %Wlug*1000;
    minTopLugD(end+1) = Ddisp;
    minTopLugt(end+1) = minWvalues(2);
    %fprintf('Min weight %.0f lugs | m: %.2f kg | D: %.0f mm | total width: %.0f mm |t: %.0f mm | W: %.0f mm | %.2f %.2f %.2f %.2f %.2f %.2f %.2f\n',nTLugs,minWdisp,Ddisp,minWvalues(1),minWvalues(2),minWvalues(3),minWvalues(4),minWvalues(5),minWvalues(6),minWvalues(7),minWvalues(8),minWvalues(9),minWvalues(10))
    %fprintf('--Min weight %.0f lugs | m: %.2f kg | D: %.0f mm | total width: %.0f mm | t: %.0f mm | W: %.0f mm | %.2f %.2f %.2f %.2f %.2f %.2f %.2f %.2f\n',nTLugs,minWdisp*0.453592,Ddisp,minWvalues(1),minWvalues(2),minWvalues(3),minWvalues(4),minWvalues(5),minWvalues(6),minWvalues(7),minWvalues(8),minWvalues(9),minWvalues(10),minWvalues(11))
    
    try
        fprintf('--Min weight %.0f lugs | m: %.2f kg | D: %.0f mm | total width: %.0f mm | t: %.0f mm | W: %.0f mm | %.2f %.2f %.2f %.2f %.2f %.2f %.2f %.2f\n',nTLugs,minWdisp*0.453592,Ddisp,minWvalues(1),minWvalues(2),minWvalues(3),minWvalues(4),minWvalues(5),minWvalues(6),minWvalues(7),minWvalues(8),minWvalues(9),minWvalues(10),minWvalues(11))
    catch
        fprintf('%.0f lugs : no solution\n',nTLugs)
    end

end

